import React from "react";
import profilePhoto from "../../../../../img/icons/profile-white.png";
import './ProfilePage.css'

// eslint-disable-next-line jsx-a11y/img-redundant-alt
const ProfilePhoto = () => <img className={'profilePhoto'} src={profilePhoto} alt="Profile Photo"/>;

export default ProfilePhoto;
